<script>
function closeModal() {
  document.getElementById("detail_modal").style.display = "none";
}
// Close if clicked outside of image.
$(window).click(function() {
  closeModal();
});
//Don't close if clicked image
$('#detail_content').click(function(event){
  event.stopPropagation();
});

var detail_areas = document.getElementsByClassName("detail_area");
for(idx=0; idx < detail_areas.length; idx++){
  detail_areas[idx].onclick = function(){
    document.getElementById("detail_content").src = this.getAttribute("data");
    document.getElementById("detail_modal").style.display = "block";
    event.stopPropagation();
  };
}
</script>
